import classes from "./BtechDegree.module.css";
import iitlogo2 from "../../../assets/iitlogo2.png";
import icon from "../../../assets/list_icon.svg";

const BtechDegree = () => {

    const openInNewTab = (url) => {
    window.open(url, "_blank", "noopener,noreferrer");
  };
  const websitePatnaHandler = (event) => {
    event.preventDefault();
    openInNewTab("https://www.iitp.ac.in/");
  };

  return (
    <div className={classes.degree}>
      <h2></h2>
      <img src={iitlogo2} />
      <div className={classes.college}>
        <div className={classes.name}>
          <h3>Dr. APJ Abdul Kalam Technical University, Uttar Pradesh</h3>
          <h4>M.Tech in Computer Science</h4>
          <p>2019 - 2021</p>
        </div>
        <div className={classes.fchild}>
          <img src={icon} />
          <p>
            I have studied basic Software engineering subjects like DS,
            Algorithms, AI etc.
          </p>
        </div>
        <div className={classes.schild}>
          <img src={icon} />
          <p>
            Apart from this, I have done courses on Deep Learning, Data Science,
            Cloud Computing and Full Stack Development.
          </p>
        </div>
        <div className={classes.tchild}>
          <img src={icon} />
          <p>
            Recieved fellowship issued by Ministry of Human Resource Development
            (MHRD), Govt. of India.
          </p>
        </div>
        <button onClick={websitePatnaHandler}>Visit Website</button>
      </div>
    </div>
  );
};

export default BtechDegree;
